import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import NavbarButom from '../components/NavbarButom';

const HomePage = () => {

  return (
    <div style={{ backgroundColor: '#3500ff', minHeight: '100vh', color: 'white', paddingTop: '5rem', overflow: 'hidden', position: 'relative' }}>
      <Container fluid>
        <Row data-aos="slide-down" className="justify-content-end">
          <Col xs={12} md={10} lg={9} xl={8} className="text-end pe-4">
             <div
              style={{
                textTransform: 'uppercase',
                fontFamily: 'Anton, sans-serif',
                transform: 'skewY(5deg) perspective(650px) scaleX(3.5) rotateY(-60deg)',
                transformOrigin: 'center right',
                lineHeight: '0.8',
                letterSpacing: '-0.08em',
                fontSize: '9vw',
                color: '#000',
                fontWeight: '900',
              }}
            >
              <Link to="/studio" className="text-black text-decoration-none"><div className="py-3">Studio<br />Mega</div></Link>
              <Link to="/brigade" className="text-black text-decoration-none"><div className="py-3">The<br />Brigade</div></Link>
              <div className="py-3">Push</div>
              <div className="py-3">Onx Mask</div>
              <div className="py-3">Icon -<br />Motor<br />Sport</div>
            </div>
          </Col>
        </Row>
        <div  style={{ position: 'fixed', bottom: 80, left: 40, zIndex: 1000 }}>
          <h1 className='d-none d-md-block' style={{ fontWeight: '900', lineHeight: 0.8, fontSize: '3rem' }}>VAN<br />HOLTZ<br />CO.</h1>
          <NavbarButom />
        </div>
      </Container>
    </div>
  );
};

export default HomePage;
